import "./App.css";

function App() {
  const steps = [
    {
      id: "0",
      message: "Welcome To Claimbot",
      trigger: "1",
    },
  ];
  return (
    <div className="App">
      <ChatBot steps={steps} />
    </div>
  );
}

export default App;
